INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 1, 102601, "あたしだって\nやるときはやるよ！", 1, 0, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24001);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 1, 102601, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 1, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24002);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 1, 102601, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 2, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24003);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 2, 102601, "やったね！\nこれでようやく\nサボれるよ…", 2, 3, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24004);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 1, 102601, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 4, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24005);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 2, 102601, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 5, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24006);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 2, 102601, "あたしも意外と\nやるもんでしょ？", 2, 6, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24007);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 4, 102601, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 7, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24008);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 4, 102601, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 8, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24009);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 4, 102601, "まじめに\nやったんだけどな…\n悔しいな～", 4, 9, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24010);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 4, 102601, "やられた…\nねずみって意外と\nてごわいね", 4, 10, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24011);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 4, 102601, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 11, 10040, "2020/04/30 12:00:00", 24, 0.0, 0.0, 24012);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES ("2030/12/17 14:59:59", 0.0, "リン", 1, 102601, "疲れた…\nけど、次こそは\n守り抜くよ…", 4, 12, 10040, "2020/04/30 12:00:00", 24, 1.81, 0.0, 24013);
